import React from 'react';

import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';

import 'bootstrap/dist/css/bootstrap.css';
import kitty from '../images/orange_cat.png';
import AboutMe from './AboutMe';

export default function Navigation() {
    return (

            <Navbar className="navbar d-flex justify-content-start">
                <link rel="stylesheet"
                      href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"/>

                <img src={kitty} className="kitty" alt="logo orange cat image"/>

                <Container className="github-container d-flex justify-content-start">
                    <i className="fa fa-github"></i>
                    <Nav.Link href="https://github.com/ilgharr">GitHub</Nav.Link>
                </Container>

                <Container className="linkedin-container d-flex justify-content-start">
                    <i className="fa fa-linkedin-square"></i>
                    <Nav.Link href="https://www.linkedin.com/in/ilghar-rahno-5a40aa220/">Linkedin</Nav.Link>
                </Container>

                <Container className="about-me-container d-flex justify-content-start">
                    <AboutMe/>
                </Container>

            </Navbar>



    )
}
